import React from 'react';
import './NavTab.css';

export default function NavTab(){
    return(
        <navtab className='navtab'>
            <h1 className='navtab_title_text'>О проекте</h1>
            <div className='navtab_line'/>
            <div className=''>
                <h2 className='navtab_title_about'>Дипломный проект включал 5 этапов</h2>
                <p className=''></p>
            </div>
        </navtab>
    )
}
